-- Dumping structure for procedure database_2110222.order_load
DELIMITER //
CREATE PROCEDURE `order_load`(
	IN `p_customer_id` CHAR(36),
	IN `p_date` DATETIME
)
BEGIN

#NIRAVKUMAR CHANDUBHAI SAVSANI(2110222)		20/04/2022		created store-procedure for load customers

SELECT
        orders.order_id,
        orders.create_at,
        products.product_code,
        customers.firstname,
        customers.lastname,
        customers.city,
        orders.comments,
        products.retail_price,
        orders.quantity,
        orders.sub_total,
        orders.taxes,
		  orders.total  
    FROM orders 
    JOIN customers
        ON orders.customer_id = customers.customer_id
    JOIN products
        ON orders.product_id = products.product_id
    WHERE
        orders.customer_id = p_customer_id
        AND
        orders.create_at >= p_date;

END//
DELIMITER ;

